description:
Ketil Bjornstad and David Darling: The River (1997)
MP3, 320 bit rate

Piano and cello. Haunting, sad melodies, that flow like a river. One of my favourite albums. You don't have to be a fan of classical music to enjoy it, but rather someone who loves music in general.
